const Services = (()=> {
    return(
        <>
        <div className="my-5">
        <h2 className="text-center">Our Services</h2>
        </div>
        <section>
            <div className="container-fluid mb-5">
                <div className="row">
                    <div className="col-10 mx-auto">
                     <div className="row">
                         col-md
                     </div>
                    </div>
                </div>
            </div>
        </section>
        </>
    )
});

export default Services;
